import styles from './Skills.module.scss';

interface jsonProps {
    componentLabel: string;
    skills: {}
}


export default function Skills(skills: jsonProps) {
    console.log(skills);
    
    return (
        <section className={styles.skills}>
            <h2>${skills.componentLabel} :</h2>
            <ul>
                <li>HTML</li>
                <li>CSS</li>
                <li>JavaScript</li>
                <li>React</li>
                <li>Node</li>
                <li>Git</li>
                <li>GitHub</li>
                <li>Scrum</li>
            </ul>
        </section>
    );
}
